import './NavBar.css';
import logo from '../img/logo.png'

const Navbar = () => {
    return (  
        <header className="navbar">
            <div className="logo">
                <img src={logo}  alt = "hhher" />
            </div>
            
            <div className="link">
                <ul className = "mynavb">
                    <li><a href="/">HOME</a></li>
                
                    <li><a className="active" href="/list">BLOG</a></li>

                    <li><a href="/contact">CONTACT</a></li>
                </ul>
            </div>
        </header>

    );
}
 
export default Navbar;
